const Checkout = () => {

    const [ {basket }, dispatch] = useStateValue();

    return (
        <>
            <Checkouth1>Your Basket</Checkouth1>
            <CheckoutList>
                {basket.map((item, i)=> (
                    <CheckoutProduct
                    id= {item.id}
                    price={item.price}
                    origin={item.origin}
                    img={item.img} 
                    key/>
                ) )}
                
            </CheckoutList>
        </>
    )
}

export default Checkout
